import React from "react";
import { View } from "react-native";
import { WebView } from "react-native-webview";

// HTML-Datei als Text importieren
import statistics from "../Components/Statistics/statistics.html";

const Graphs = () => {
    return (
        <View style={{ flex: 1 }}>
            <WebView
                originWhitelist={["*"]}
                source={{ html: statistics }} // HTML als String verwenden
            />
        </View>
    );
};

export default Graphs;
